//app.js
App({
  onLaunch: function () {
    
    if (!wx.cloud) {
      console.error('请使用 2.2.3 或以上的基础库以使用云能力')
    } else {
      wx.cloud.init({
        traceUser: true,
      })
    }

    this.globalData = {
      server_url: 'https://api.im-here.cn/api/',
      icon_exit: 'data:image/png;base64,',
      icon_check: 'data:image/png;base64,',
      icon_setting: 'data:image/png;base64,',
      icon_status: 'data:image/png;base64,',
      icon_share: 'data:image/png;base64,',
      icon_pen: 'data:image/png;base64,',
      
    }
  }
})
